  false,\n\t\"url\": null,\n\t\"notes\": \"Submarine canyons occur at the edge of
  the continental shelf and cut across the slope and rise along the U.S. east coast.
  Three of these canyons (Oceanographer, Lydonia, and Gilbert) are situated south
  of Georges Bank. Gravity cores and grab samples were collected as part of a study
  of the active processes and sediment distributions within these features. The results
  of the textural analyses are contained in this data layer.\",\n\t\"owner_org\":
